Biz insanlara bu çocuklar candır hediye olmaz! Satılmaz! heves için alıp hayatlarıyla oynamayın! 3 gün sonra yok tüyü yok çişi yok alerjisi diye sokağa atıyorsunuz ve ölümlerine sebep oluyorsunuz. En iyi ihtimalle hasta ya da yaralı olarak bizim gibi gönüllüler tarafından bulunup tedaviye alınıyor ve onlarca acı çekiyor diyoruz. Siz bu 'cici' çocuğu hediye ediyorsunuz öyle mi?!! Yıl 2020 insanların tüketim manyaklığında zirvenin bedelini dünya ödüyor ve siz hala uyanmıyorsunuz. Azıcık kafanızı kullanın. Avustralya hiçbir şey öğretmediyse kendi ülkenize bakın. .doğanın hiçbir canlısı sizin eğlenceniz değil !
Kendinize gelin artık. Çocuklarımızın geleceğini çalıyorsunuz!!!
@albina_beauty_studio daha ne gerek bu çocukların can olduğunu anlamanız için!!! Reklam mantığınıza lanet olsun!

